import React from "react";
import ProductCard from "../components/ProductCard";

const dummyProducts = [
  { id: 1, name: "Vintage Jacket", price: 799 },
  { id: 2, name: "Retro Sneakers", price: 1299 },
  { id: 3, name: "Leather Bag", price: 999 },
];

const Shop = () => {
  return (
    <div style={{ padding: "2rem" }}>
      <h2>Shop Items</h2>
      <div style={{ display: "flex", gap: "1rem", flexWrap: "wrap" }}>
        {dummyProducts.map((p) => (
          <ProductCard key={p.id} product={p} />
        ))}
      </div>
    </div>
  );
};

export default Shop;
